import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  const [isScrolled, setIsScrolled] = useState(false);
  const [showMobileMenu, setShowMobileMenu] = useState(false);
  const [showProfileDropdown, setShowProfileDropdown] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 0) {
        setIsScrolled(true);
      } else {
        setIsScrolled(false);
      }
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <nav className={`netflix-navbar ${isScrolled ? 'scrolled' : ''}`}>
      <div className="navbar-left">
        <Link to="/" className="netflix-logo">
          <svg viewBox="0 0 111 30" className="netflix-svg">
            <g id="netflix-logo">
              <path d="M105.06233,14.2806261 L110.999156,30 C109.249227,29.7497422 107.500234,29.4366857 105.718437,29.1554972 L102.374168,20.4686475 L98.9371075,28.4375293 C97.2499766,28.1563408 95.5928391,28.061674 93.9057081,27.8432843 L99.9372012,14.0931671 L94.4680851,-5.68434189e-14 L99.5313525,-5.68434189e-14 L102.593495,7.87421502 L105.874965,-5.68434189e-14 L110.999156,-5.68434189e-14 L105.06233,14.2806261 Z" fill="#e50914"></path>
            </g>
          </svg>
        </Link>
        
        <div className={`nav-links ${showMobileMenu ? 'mobile-visible' : ''}`}>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/tv-shows">TV Shows</Link></li>
            <li><Link to="/movies">Movies</Link></li>
            <li><Link to="/latest">New & Popular</Link></li>
            <li><Link to="/my-list">My List</Link></li>
          </ul>
        </div>
      </div>

      <div className="navbar-right">
        <div className="search-box">
          <i className="fas fa-search"></i>
          <input type="text" placeholder="Titles, people, genres" />
        </div>
        
        <div className="notifications">
          <i className="fas fa-bell"></i>
        </div>
        
        <div 
          className="profile-dropdown" 
          onClick={() => setShowProfileDropdown(!showProfileDropdown)}
        >
          <div className="profile-avatar">
            <img src="https://i.imgur.com/1bX5QH6.png" alt="Profile" />
            <i className={`fas fa-caret-down ${showProfileDropdown ? 'rotate' : ''}`}></i>
          </div>
          
          {showProfileDropdown && (
            <div className="dropdown-menu">
              <Link to="/account">Account</Link>
              <Link to="/help">Help Center</Link>
              <Link to="/logout">Sign out of Netflix</Link>
            </div>
          )}
        </div>
        
        <div 
          className="mobile-menu-toggle" 
          onClick={() => setShowMobileMenu(!showMobileMenu)}
        >
          <i className={`fas ${showMobileMenu ? 'fa-times' : 'fa-bars'}`}></i>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
